window.bookSummaryJSON = "<p>A man awakens, adrift in deep space, with little memory of who he is - only to discover that he is the commander of a space mission; the rest of the crew is gone; and he is apparently a writer of some small renown named Neil Gaiman.</p> <p><i>The Neil Gaiman at the End of the Universe</i> is perfect for fans of <i>The Hitchhikerâ€™s Guide to the Galaxy</i> and <i>Black Mirror</i>. It stars Neil Gaiman as... well, you know, and Jewel Staite (<i>Firefly</i>; <i>Stargate Atlantis</i>), and is written by Arvind Ethan David, executive producer of <i>Dirk Gently's Holistic Detective Agency</i>.</p> <p><b>Please note: </b>Proceeds obtained by the producer from sales of this audio project will benefit This Is My Brave, a nonprofit organization that seeks to break the stigma of mental illness, alcoholism and substance abuse, sexual assault, eating disorders, and more through the power of live storytelling.</p>"; 
